Sapphire, the birthstone of September is one of the most beautiful and highly coveted gem in the world of gemology.

Sapphire along with rubies and emerald has always maintained its well defined status in the world of gemology.

Oldest stone in the British crown jewel is St.Edwards Sapphire. As its colour blue is symbolic of heaven it became the bishops Gemstone of choice only to be replaced by Amethyst...

The British coronation ring is made around a blue sapphire

Sapphire belongs to the gem species corundum which is derived from Sanskrit word "kuruvindam" ...ruby and sapphire both are twins as they both belong the same family...

In India it is always worn due to astrological reasons and weight of the stone is always according to the weight of the body...a rough idea is that a person weighing 50 kg wears 5 carat+,60 kg 6 carat+ so on and so forth....

